	[character]
	_addr="0x1f0b1c00"
	current_frame="normal"
	custom="yes"
	face_right="yes"
	label="Greeter"
	on_talk="[
		speech_dialog(
				self, 				[~Welcome to Woodenhead.\nI'm the town guard.~],
									
				level.player,		set(level.player.animation, 'emote_talk'),
									[~That's nice. Why does the\ntown need a guard?~],
									
				self,				[~I operate the lift, mostly.\nBut, guarding pays less.\nSo, I'm a guard.\nIt's still good money.~],
									
				level.player,		set(level.player.animation, 'emote_nod'),
									[~It looks like an easy job,\nthough a bit slow.\nCan you tell me a\nbit about Woodenhead?~],
									
				self,				[~Sure, nothing else doing.\nWhat do you want to know?~],
									
				level.player,		[~1: Why is it called Woodenhead?\n2: Why's the town here?~, 
										~Opt. 1~, [
											speech_dialog(
												self,				[~I think it's got something to\ndo with 'minehead' and the\nfact we're in the woods.~],
																	
												level.player,		set(level.player.animation, 'emote_oh'),
																	[~Reasonable enough.~],
												),
										],
										~Opt. 2~, [
											speech_dialog(
												self,				[~The town was built by the\ncompany to mine the trees\naround these parts. We\nexport wood products to most\nof the country. Wood blocks,\nwood shavings, carvings, most\nof it came from here.\nIt's too dangerous to fell\ntrees here, what with the\nbugs and all those things\ncrawling around. Even up\nhere, the bugs are pretty bad.~],
																	
												level.player,		set(level.player.animation, 'emote_nod'),
																	[~I've been around, you'd\nnever get any work done.~],
																	
												self,				[~But the worst of it is,\nthere is some sort of...\nFUNGUS growing all over the\nforest now. It didn't use\nto be there when I started.\nWe had a camp over in\nWesthailia which got totally\nengulfed by the stuff. I\nexpect that even this camp\nwill be run over eventually.\nBut that won't be for\na while yet. We can\nalways break camp and move\non, but this fungus is\nhurting sales too! Still, I\nguess it could be worse.~],
																	
												level.player,		set(level.player.animation, 'emote_talk'),
																	[~Yeah, the town is in trouble.\nYou could work there.~],
																	
												self,				[~Oh, I hadn't heard.\nI have some family over there.\nI'll send them some money\nif they have to relocate.\nI hope they don't.~],
												),
										],
										~More...~, [
											speech_dialog(
												level.player,		[~3: Could you start the lift?~,
													~Opt. 3~, [
														speech_dialog(
															self,				[~Sure, no problem.~],
															
															level.player,		set(level.player.animation, 'emote_confused'),
																				[~How'd you do that?~], #He has a foot lever, sourcie.#
														),
														fire_event(get_object(level, 'Lift Basket'), 'start'),
													],
													~Cancel~, [
														speech_dialog(
															level.player,		set(level.player.animation, 'emote_confused'),
																				[~Uh, I forgot. Sorry.~],
															
															),
													],
												]
											)
										],
									],
				),
		]"
